    f = lambda: map(int, input().split())
    n, k = f()
    main_courses = set(f())
    graph = [[] for _ in range(n+1)]
    for _ in range(n):
        u, *v = f()
        for x in v:
            graph[u].append(x)
    visited = [False] * (n+1)
    def dfs(u):
        if visited[u]:
            return False
        visited[u] = True
        for v in graph[u]:
            if dfs(v):
                return True
        return u in main_courses
    count = 0
    for i in range(1, n+1):
        if dfs(i):
            count += 1
    if count == k:
        return count, sorted(i for i in range(1, n+1) if dfs(i))
    return -1, -1

