        graph[b].append(a)
    def dfs(node, parent, depth, visited, memo):
        if node in memo:
            return memo[node]
        memo[node] = depth
        for child in graph[node]:
            if child != parent:
                memo[node] = max(memo[node], dfs(child, node, visited, memo))
        return memo[node]
    memo = {i:0 for i in range(1, n+1)}
    for i in range(1, n+1):
        memo[i] = dfs(i, -1, set(), memo)
    max_depth = max(memo.values())
    max_depth_nodes = [i for i, depth in memo.items() if depth == max_depth]
    answer = 0
    for node in max_depth_nodes:
        for child in graph[node]:
            if child not in max_depth_nodes:
                answer += memo[node]
                print(node, child, node)
                break
    return answer

