    N,u,v=f()
    adj=[[0]*N for _ in range(N)]
    for i in range(N-1):
        a,b=f()
        adj[a-1][b-1]=1
        adj[b-1][a-1]=1
    #print(adj)
    def dfs(u,v,visited,depth):
        if u==v:
            return depth
        visited[u]=1
        for i in range(N):
            if adj[u][i] and visited[i]==0:
                depth+=1
                depth=max(dfs(i,v,visited,depth),depth)
        return depth
    visited=[0]*N
    return dfs(u,v,visited,0)

