            tree[node][2] = target
            return cost
    def shuffle(node, parent, visited, cost, target):
        if visited[node]:
            return cost
        visited[node] = True
        for child in tree[node]:
            if child != parent:
                cost = shuffle(child, node, cost, target)
        if tree[node][2] == target:
            return cost
        else:
            cost += tree[node][0]
            tree[node][2] = target
            return cost
    visited = [False] * (N+1)
    cost = 0
    for i in range(1, N+1):
        if not visited[i]:
            cost = dfs(i, -1, visited, cost, tree[i][2])
    if any(not visited[i] for i in range(1, N+1)):
