    n = int(input())
    a = list(map(int, input().split()))
    tree = [[] for _ in range(n)]
    for _ in range(n-1):
        u, v = map(int, input().split())
        tree[u-1].append(v-1)
        tree[v-1].append(u-1)
    def dfs(node, visited, parent, max_sum, memo):
        if node in visited:
            return max_sum
        visited.add(node)
        for child in tree[node]:
            if child != parent:
                max_sum = max(max_sum, dfs(child, visited, node, max_sum, memo))
        memo[node] = max_sum
        return max_sum
    max_sum = dfs(0, set(), 0, {})
    for i in range(n):
        if i not in memo:
            max_sum = max(max_sum, dfs(i, set(), 0, {}))
    return max_sum

