def solution(input_string):
    n,m = map(int,input().split())
    edges = []
    for i in range(m):
        u,v,w = map(int,input().split())
        edges.append((u-1,v-1,w))
    edges.sort(key=lambda x: x[2])
    parent = [-1]*n
    rank = [0]*n
    def find(u):
        if parent[u] == -1:
            return u
        if parent[u] == u:
            return u
        parent[u] = find(parent[u])
        return parent[u]
    def union(u,v):
        if rank[u] > rank[v]:
            parent[v] = u
        else:
            parent[u] = v
            if rank[u] == rank[v]:
                rank[v] += 1
    def kruskal():
        mst = []
        for u,v,w in edges:
            if find(u) != find(v):
                mst.append((u,v,w))
                union(u,v)
        return mst
    def mst_cost(mst):
        return sum(w for u,v,w in mst)
    def min_weight_edge(mst):
        min_weight = float('inf')
        for u,v,w in mst:
            if w < min_weight:
                min_weight = w
        return min_weight
    def min_operations(mst, k):
        return (k - mst_cost(mst)) // min_weight_edge(mst)
    mst = kruskal()
    return min_operations(mst, k)

