    n, m = map(int, input_string.split())
    # create a graph with n nodes and m edges
    graph = [[] for _ in range(n)]
    for i in range(n):
        graph[i].append(i)
    # add edges to the graph
    for i in range(m):
        a, b = map(int, input().split())
        graph[a-1].append(b-1)
        graph[b-1].append(a-1)
    # find the maximum cost of plowing the roads
    def dfs(node, visited, cost, depth):
        if visited[node]:
            return cost
        visited[node] = True
        for neighbor in graph[node]:
            if not visited[neighbor]:
                cost = max(cost, dfs(neighbor, visited, cost+depth))
        return cost
    # find the maximum cost of plowing the roads
    max_cost = 0
    for i in range(n):
        visited = [False] * n
        max_cost = max(max_cost, dfs(i, visited, 1))
    return max_cost

