        else:
            row1, col1 = table.index(input_string[i]), table[0].index(input_string[i])
            if i+1 < len(input_string):
                if input_string[i+1] == "X":
                    encrypted_text += table[row1][(col1+1)%5]
                else:
                    row2, col2 = table.index(input_string[i+1]), table[0].index(input_string[i+1])
                    if row1 == row2:
                        encrypted_text += table[row1][(col1+1)%5] + table[row1][(col2+1)%5]
                    elif col1 == col2:
                        encrypted_text += table[(row1+1)%5][col1] + table[(row2+1)%5][col2]
